import React from 'react';

export default function Todo({ todo, dispatchTodos }) {
    return (
        <div className="todo-item">
            <div className="todo-item-header">
                <span className="todo-item-title">{todo.title}</span>
                <span className="todo-author-date">Written by {todo.author} on {new Date(todo.date).toLocaleDateString()}</span>
            </div>
            <p className="todo-item-description">{todo.description}</p>
        <input type="checkbox" checked={todo.completed} onChange={() => toggleTodo(todo.id)} />
        {todo.completed && <span className="todo-author-date">Completed on: {new Date(todo.dateCompleted).toLocaleDateString()}</span>}
    </div>
    );
}
